import React from "react";

import { Pagination } from "semantic-ui-react";

export default function PaginationBar({ cardsPerPage, totalCards }) {
  const totalPages = totalCards / cardsPerPage;

  return (
    <div>
      <Pagination defaultActivePage={5} totalPages={totalPages} />
    </div>
  );
}
